CREATE FUNCTION mcl.check_column_problem_uniqueness() RETURNS trigger
    LANGUAGE plpgsql
    AS $$ DECLARE v_problem_id INTEGER; BEGIN SELECT s.problem_id INTO v_problem_id FROM mcl.column_problem_solutions s WHERE s.id = NEW.solution_id; IF v_problem_id IS NULL THEN RAISE EXCEPTION 'Способ решения проблем колонок % не найден', NEW.solution_id; END IF; IF EXISTS (SELECT 1 FROM mcl.mssql_columns_problems_mapping m JOIN mcl.column_problem_solutions s2 ON m.solution_id = s2.id WHERE m.column_id = NEW.column_id AND s2.problem_id = v_problem_id AND m.id != COALESCE(NEW.id, 0)) THEN RAISE EXCEPTION 'Колонка % уже имеет проблему %. Уникальность нарушена.', NEW.column_id, v_problem_id; END IF; RETURN NEW; END; $$;


