--
-- Name: check_derived_type_problem_uniqueness(); Type: FUNCTION; Schema: mcl; Owner: postgres
--

CREATE FUNCTION mcl.check_derived_type_problem_uniqueness() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF EXISTS (
        SELECT 1
        FROM mcl.problems_ct_slt_mp
        WHERE derived_type_id = NEW.derived_type_id
          AND solution_id = NEW.solution_id
          AND solution_status = 'active'
          AND id IS DISTINCT FROM NEW.id
    ) THEN
        RAISE EXCEPTION 'Duplicate active problem for derived type % with solution %', NEW.derived_type_id, NEW.solution_id;
    END IF;
    RETURN NEW;
END;
$$;


