--
-- Name: check_table_problem_uniqueness(); Type: FUNCTION; Schema: mcl; Owner: postgres
--

CREATE FUNCTION mcl.check_table_problem_uniqueness() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    problem_id_val INTEGER;
    table_name_val VARCHAR(255);
    problem_name_val VARCHAR(255);
BEGIN
    -- Получение ID проблемы из способа решения
    SELECT problem_id INTO problem_id_val
    FROM mcl.problems_tb_slt 
    WHERE id = NEW.solution_id;
    
    -- Получение имен для информативного сообщения об ошибке
    SELECT object_name INTO table_name_val
    FROM mcl.mssql_tables 
    WHERE id = NEW.table_id;
    
    SELECT problem_name INTO problem_name_val
    FROM mcl.problems_tb 
    WHERE id = problem_id_val;
    
    -- Проверка уникальности связи таблица-проблема
    -- Ищем существующие связи между той же таблицей и той же проблемой
    IF EXISTS (
        SELECT 1 
        FROM mcl.problems_tb_slt_mp mp
        INNER JOIN mcl.problems_tb_slt s ON mp.solution_id = s.id
        WHERE mp.table_id = NEW.table_id 
        AND s.problem_id = problem_id_val
        AND mp.id != COALESCE(NEW.id, 0)  -- Исключаем текущую запись при UPDATE
    ) THEN
        RAISE EXCEPTION 'ОШИБКА УНИКАЛЬНОСТИ: Таблица ''%'' (ID: %) уже связана с проблемой ''%'' (ID: %). Одна таблица не может быть связана с одной проблемой дважды, даже разными способами решения.', 
            table_name_val, NEW.table_id, problem_name_val, problem_id_val;
    END IF;
    
    RETURN NEW;
END;
$$;


