-- Name: normalize_sequence_name(character varying); Type: FUNCTION; Schema: mcl; Owner: postgres
--

CREATE FUNCTION mcl.normalize_sequence_name(source_name character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
    result VARCHAR;
BEGIN
    -- Удаляем префикс SEQ_ и приводим к нижнему регистру
    result := LOWER(REGEXP_REPLACE(source_name, '^SEQ_', '', 'g'));
    
    -- Заменяем заглавные буквы на подчеркивания + строчные
    result := REGEXP_REPLACE(result, '([a-z])([A-Z])', '\1_\2', 'g');
    
    -- Заменяем множественные подчеркивания на одинарные
    result := REGEXP_REPLACE(result, '_+', '_', 'g');
    
    -- Удаляем недопустимые символы
    result := REGEXP_REPLACE(result, '[^a-z0-9_]', '_', 'g');
    
    -- Убираем подчеркивания в начале и конце
    result := TRIM(result, '_');
    
    -- Добавляем префикс seq_
    result := 'seq_' || result;
    
    -- Ограничиваем длину до 63 символов
    IF LENGTH(result) > 63 THEN
        result := LEFT(result, 60) || '_pg';
    END IF;
    
    RETURN result;
END;
$$;


