--
-- Name: v_derived_type_problems; Type: VIEW; Schema: mcl; Owner: postgres
--

CREATE VIEW mcl.v_derived_type_problems AS
 SELECT mdt.id AS derived_type_id,
    mdt.base_type_id,
    mbt.base_type_name,
    mbt.type_category,
    mbt.type_family,
    mdt.precision_value,
    mdt.scale_value,
    mdt.length_value,
    mdt.is_nullable,
    mdt.max_value,
    mdt.task_id,
    pct.id AS problem_id,
    pct.problem_name,
    pct.problem_description,
    pct.problem_category,
    pct.severity_level,
    pct.problem_context,
    pct.migration_impact,
    pct.created_at AS problem_created_at,
    pct.updated_at AS problem_updated_at,
    pcts.id AS solution_id,
    pcts.solution_name,
    pcts.solution_description,
    pcts.solution_category,
    pcts.complexity_level,
    pcts.est_impl_time,
    pcts.created_at AS solution_created_at,
    pcts.updated_at AS solution_updated_at,
    pctmp.id AS mapping_id,
    pctmp.solution_status,
    pctmp.problem_detected_date,
    pctmp.problem_resolved_date,
    pctmp.resolution_notes,
    pctmp.created_at AS mapping_created_at,
    pctmp.updated_at AS mapping_updated_at,
        CASE
            WHEN (pctmp.problem_resolved_date IS NOT NULL) THEN 'resolved'::text
            WHEN ((pctmp.solution_status)::text = 'active'::text) THEN 'active'::text
            ELSE 'unknown'::text
        END AS overall_status,
        CASE
            WHEN (pctmp.problem_resolved_date IS NOT NULL) THEN (EXTRACT(epoch FROM (pctmp.problem_resolved_date - pctmp.problem_detected_date)) / (3600)::numeric)
            ELSE NULL::numeric
        END AS resolution_hours,
    pdt.id AS target_derived_type_id,
    pdt.base_type_id AS target_base_type_id,
    pbt.base_type_name AS target_base_type_name,
    pbt.type_category AS target_type_category,
    pbt.type_family AS target_type_family,
    pdt.precision_value AS target_precision_value,
    pdt.scale_value AS target_scale_value,
    pdt.length_value AS target_length_value,
    pdt.is_nullable AS target_is_nullable,
    pdt.max_value AS target_max_value,
    pdt.migration_quality AS target_migration_quality,
    pdt.performance_rating AS target_performance_rating,
    pdt.validation_rules AS target_validation_rules,
    pdt.notes AS target_notes,
    pdt.typname_with_params AS target_typname_with_params
   FROM ((((((mcl.mssql_derived_types mdt
     JOIN mcl.mssql_base_types mbt ON ((mdt.base_type_id = mbt.id)))
     LEFT JOIN mcl.problems_ct_slt_mp pctmp ON ((mdt.id = pctmp.derived_type_id)))
     LEFT JOIN mcl.problems_ct_slt pcts ON ((pctmp.solution_id = pcts.id)))
     LEFT JOIN mcl.problems_ct pct ON ((pcts.problem_id = pct.id)))
     LEFT JOIN mcl.postgres_derived_types pdt ON ((mdt.id = pdt.source_derived_type_id)))
     LEFT JOIN mcl.postgres_base_types pbt ON ((pdt.base_type_id = pbt.id)))
  WHERE (mdt.task_id = 2);


ALTER VIEW mcl.v_derived_type_problems OWNER TO postgres;

--
-- Name: v_derived_type_problems_active; Type: VIEW; Schema: mcl; Owner: postgres
--

CREATE VIEW mcl.v_derived_type_problems_active AS
 SELECT mdt.id AS derived_type_id,
    mbt.base_type_name,
    pct.problem_name,
    pcts.solution_name,
    pctmp.solution_status,
    pctmp.problem_detected_date
   FROM ((((mcl.mssql_derived_types mdt
     JOIN mcl.mssql_base_types mbt ON ((mdt.base_type_id = mbt.id)))
     JOIN mcl.problems_ct_slt_mp pctmp ON ((mdt.id = pctmp.derived_type_id)))
     JOIN mcl.problems_ct_slt pcts ON ((pctmp.solution_id = pcts.id)))
     JOIN mcl.problems_ct pct ON ((pcts.problem_id = pct.id)))
  WHERE (((pctmp.solution_status)::text = 'active'::text) AND (mdt.task_id = 2));


ALTER VIEW mcl.v_derived_type_problems_active OWNER TO postgres;

--
-- Name: v_problems_by_type; Type: VIEW; Schema: mcl; Owner: postgres
--

CREATE VIEW mcl.v_problems_by_type AS
 SELECT pct.problem_name,
    pct.problem_category,
    pct.severity_level,
    count(mdt.id) AS affected_types_count,
    string_agg((mbt.base_type_name)::text, ', '::text) AS affected_base_types,
    count(
        CASE
            WHEN ((pctmp.solution_status)::text = 'resolved'::text) THEN 1
            ELSE NULL::integer
        END) AS resolved_count,
    count(
        CASE
            WHEN ((pctmp.solution_status)::text = 'active'::text) THEN 1
            ELSE NULL::integer
        END) AS active_count,
    count(
        CASE
            WHEN (pctmp.solution_status IS NULL) THEN 1
            ELSE NULL::integer
        END) AS unresolved_count,
        CASE
            WHEN (count(
            CASE
                WHEN ((pctmp.solution_status)::text = 'resolved'::text) THEN 1
                ELSE NULL::integer
            END) = count(mdt.id)) THEN 'fully_resolved'::text
            WHEN (count(
            CASE
                WHEN ((pctmp.solution_status)::text = 'resolved'::text) THEN 1
                ELSE NULL::integer
            END) > 0) THEN 'partially_resolved'::text
            WHEN (count(
            CASE
                WHEN ((pctmp.solution_status)::text = 'active'::text) THEN 1
                ELSE NULL::integer
            END) > 0) THEN 'in_progress'::text
            ELSE 'not_started'::text
        END AS resolution_status,
    min(pctmp.problem_detected_date) AS first_detected_date,
    max(pctmp.problem_resolved_date) AS last_resolved_date,
    avg(
        CASE
            WHEN (pctmp.problem_resolved_date IS NOT NULL) THEN (EXTRACT(epoch FROM (pctmp.problem_resolved_date - pctmp.problem_detected_date)) / (3600)::numeric)
            ELSE NULL::numeric
        END) AS avg_resolution_hours,
    string_agg(DISTINCT (pcts.solution_name)::text, ', '::text) AS applied_solutions,
    string_agg(DISTINCT (pbt_target.base_type_name)::text, ', '::text) AS target_types
   FROM ((((((mcl.problems_ct pct
     JOIN mcl.problems_ct_slt pcts ON ((pct.id = pcts.problem_id)))
     LEFT JOIN mcl.problems_ct_slt_mp pctmp ON ((pcts.id = pctmp.solution_id)))
     LEFT JOIN mcl.mssql_derived_types mdt ON ((pctmp.derived_type_id = mdt.id)))
     LEFT JOIN mcl.mssql_base_types mbt ON ((mdt.base_type_id = mbt.id)))
     LEFT JOIN mcl.postgres_derived_types pdt ON ((mdt.id = pdt.source_derived_type_id)))
     LEFT JOIN mcl.postgres_base_types pbt_target ON ((pdt.base_type_id = pbt_target.id)))
  WHERE (mdt.task_id = 2)
  GROUP BY pct.id, pct.problem_name, pct.problem_category, pct.severity_level;


ALTER VIEW mcl.v_problems_by_type OWNER TO postgres;

--
-- Name: v_sequence_migration_status; Type: VIEW; Schema: mcl; Owner: postgres
--

CREATE VIEW mcl.v_sequence_migration_status AS
 SELECT mt.object_name AS source_table,
    mc.column_name AS source_column,
    mic.seed_value,
    mic.increment_value,
    mic.current_value,
    pt.object_name AS target_table,
    pc.column_name AS target_column,
    ps.sequence_name AS target_sequence,
    ps.migration_status,
    ps.migration_date,
    ps.error_message,
        CASE
            WHEN (ps.id IS NULL) THEN '❌ Не создан'::text
            WHEN ((ps.migration_status)::text = 'completed'::text) THEN '✅ Мигрирован'::text
            WHEN ((ps.migration_status)::text = 'failed'::text) THEN '❌ Ошибка'::text
            WHEN ((ps.migration_status)::text = 'pending'::text) THEN '⏳ Ожидает'::text
            ELSE '❓ Неизвестно'::text
        END AS status_icon
   FROM (((((mcl.mssql_identity_columns mic
     JOIN mcl.mssql_tables mt ON ((mic.table_id = mt.id)))
     JOIN mcl.mssql_columns mc ON ((mic.column_id = mc.id)))
     LEFT JOIN mcl.postgres_sequences ps ON ((mic.id = ps.source_identity_column_id)))
     LEFT JOIN mcl.postgres_tables pt ON ((ps.table_id = pt.id)))
     LEFT JOIN mcl.postgres_columns pc ON ((ps.column_id = pc.id)))
  ORDER BY mt.object_name, mc.column_name;


ALTER VIEW mcl.v_sequence_migration_status OWNER TO postgres;

--
-- Name: v_trigger_migration_status; Type: VIEW; Schema: mcl; Owner: postgres
--

CREATE VIEW mcl.v_trigger_migration_status AS
 SELECT mt.object_name AS source_table,
    mtr.trigger_name AS source_trigger,
    mtr.trigger_type,
    mtr.event_type,
    mtr.is_disabled,
    pt.object_name AS target_table,
    ptr.trigger_name AS target_trigger,
    ptr.migration_status,
    ptr.migration_date,
    ptr.error_message,
        CASE
            WHEN (ptr.id IS NULL) THEN '❌ Не создан'::text
            WHEN ((ptr.migration_status)::text = 'completed'::text) THEN '✅ Мигрирован'::text
            WHEN ((ptr.migration_status)::text = 'failed'::text) THEN '❌ Ошибка'::text
            WHEN ((ptr.migration_status)::text = 'pending'::text) THEN '⏳ Ожидает'::text
            ELSE '❓ Неизвестно'::text
        END AS status_icon
   FROM (((mcl.mssql_triggers mtr
     JOIN mcl.mssql_tables mt ON ((mtr.table_id = mt.id)))
     LEFT JOIN mcl.postgres_triggers ptr ON ((mtr.id = ptr.source_trigger_id)))
     LEFT JOIN mcl.postgres_tables pt ON ((ptr.table_id = pt.id)))
  ORDER BY mt.object_name, mtr.trigger_name;


ALTER VIEW mcl.v_trigger_migration_status OWNER TO postgres;

