12	Проблема совместимости типа uniqueidentifier	Тип uniqueidentifier в MS SQL Server не имеет прямого аналога в PostgreSQL. Требуется маппинг на UUID с дополнительной обработкой.	type_compatibility	high	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	Тип uniqueidentifier используется для хранения глобально уникальных идентификаторов. В PostgreSQL эквивалентом является UUID, но требуется проверка совместимости форматов и функций генерации.	critical
13	Проблема совместимости типа money	Тип money в MS SQL Server имеет специфичную точность и масштаб. В PostgreSQL требуется маппинг на decimal(19,4) с проверкой точности вычислений.	type_compatibility	high	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	Тип money в MS SQL Server имеет фиксированную точность 19 цифр и масштаб 4. При миграции в PostgreSQL decimal(19,4) могут возникнуть проблемы с округлением и точностью вычислений.	critical
14	Проблема совместимости типа datetime	Тип datetime в MS SQL Server имеет другую точность и диапазон значений по сравнению с timestamp в PostgreSQL.	type_compatibility	high	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	MS SQL Server datetime имеет точность до 3.33 миллисекунд и диапазон 1753-9999, в то время как PostgreSQL timestamp имеет точность до микросекунд и больший диапазон. Требуется проверка корректности конвертации.	critical
15	Проблема маппинга типа decimal	Тип decimal в MS SQL Server требует точного соответствия precision и scale при миграции в PostgreSQL.	type_mapping	medium	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	MS SQL Server decimal может иметь precision от 1 до 38 и scale от 0 до precision. В PostgreSQL numeric имеет аналогичные ограничения, но требуется проверка соответствия значений precision и scale.	moderate
16	Проблема маппинга типа float	Тип float в MS SQL Server имеет специфичную реализацию с плавающей точкой, которая может отличаться от PostgreSQL double precision.	type_mapping	medium	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	MS SQL Server float соответствует IEEE 754, но может иметь различия в точности и округлении по сравнению с PostgreSQL double precision. Требуется тестирование точности вычислений.	moderate
17	Проблема маппинга строковых типов	Типы char, varchar, nvarchar в MS SQL Server требуют учета кодировки и collation при миграции в PostgreSQL.	type_mapping	medium	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	MS SQL Server использует Unicode (nvarchar) и ANSI (char, varchar) с различными collation. PostgreSQL использует UTF-8 по умолчанию. Требуется проверка корректности конвертации кодировок и collation.	moderate
18	Проблема конвертации целочисленных типов	Типы bigint, int, smallint, tinyint в MS SQL Server имеют специфичные диапазоны значений, которые должны быть проверены при миграции.	type_conversion	low	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	MS SQL Server tinyint (0-255), smallint (-32768 to 32767), int (-2^31 to 2^31-1), bigint (-2^63 to 2^63-1). PostgreSQL имеет аналогичные типы, но требуется проверка корректности конвертации значений.	low
19	Проблема конвертации типа date	Тип date в MS SQL Server и PostgreSQL имеют одинаковую функциональность, но могут отличаться в обработке граничных значений.	type_conversion	low	2025-09-05 07:35:44.430541	2025-09-05 07:35:44.430541	Оба типа поддерживают диапазон 0001-01-01 до 9999-12-31, но могут отличаться в обработке високосных лет и граничных значений. Требуется проверка корректности конвертации.	low
